import axios from 'axios';
import { FETCH_NOTES, ADD_NOTE } from './types';

export const fetchNotes = () => dispatch => {
    axios
      .get('/api/notes')
      .then((res) => res.json())
      .then((notes) =>
        dispatch({
          type: FETCH_NOTES,
          payload: notes,
        })
      );

}
